import React from 'react';
import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';


function ShopDropdown() {
    return (
        <>
        <DropdownButton
          variant="primary"
          title="SHOP"
        >
          <Dropdown.Item href="/hats">Hats</Dropdown.Item>
          <Dropdown.Item href="/jackets">Jackets</Dropdown.Item>
          <Dropdown.Item href="/sneakers">Sneakers</Dropdown.Item>
          <Dropdown.Item href="/womens">Womens</Dropdown.Item>
          <Dropdown.Item href="/mens">Mens</Dropdown.Item>
        </DropdownButton>
      </>
    );
}
export default ShopDropdown;
